import React, { useState } from "react";
import { Input } from "../../Components/Input";
import { Button } from "../../Components/Button/Index";

const Dashboard = () => {
  const arr = [
    {
      title: "Intro to CSS",
      author: "Adam",
    },
    {
      title:
        "A Long and Winding Tour of the History of UI Frameworks and Tools and Impact on the Design",
      author: "Adam",
    },
    {
      title: "This is for Testing",
      author: "Ahmad",
    },
  ];

  const [items, setItems] = useState(arr);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const handleClick = (e) => {
    e.preventDefault();
    let obj = {
      title: e.target["title"].value,
      author: e.target["author"].value,
    };
    items.push(obj);
    setItems([...items]);
    setIsModalOpen(false);
  };

  return (
    <div className="flex justify-center items-center min-h-screen">
      <div className="border border-gray-300 bg-slate-100 shadow-md rounded px-8 pt-6 pb-8 mb-4">
        <Button
          type="submit"
          size="large"
          className=""
          onClick={() => setIsModalOpen(true)}
        >
          Add
        </Button>
        <table className="table-auto">
          <thead>
            <tr>
              <th className="px-4 py-2 text-gray-600">Title</th>
              <th className="px-4 py-2 text-gray-600">Author</th>
              <th className="px-4 py-2 text-gray-600">Actions</th>
            </tr>
          </thead>
          <tbody>
            {items.map((item, index) => (
              <tr key={index}>
                <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                  {item.title}
                </td>
                <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                  {item.author}
                </td>
                <td className="border border-gray-500 px-4 py-2 text-gray-600 font-medium">
                  <div className="flex justify-center items-center">
                    <Button type="submit" size="large" className="m-3">
                      Edit
                    </Button>
                    <Button
                      type="button"
                      size="large"
                      variant="danger"
                      onClick={() => setIsModalOpen(false)}
                    >
                      Delete
                    </Button>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <CreateModal
        setIsModalOpen={setIsModalOpen}
        isModalOpen={isModalOpen}
        handleClick={handleClick}
      />
    </div>
  );
};

export default Dashboard;

function CreateModal({ isModalOpen, setIsModalOpen, handleClick }) {
  return (
    <div
      id="authentication-modal"
      tabindex="-1"
      aria-hidden="true"
      className={`fixed flex justify-center items-center z-50 w-full p-4 overflow-x-hidden overflow-y-auto md:inset-0 h-[calc(100%-1rem)] max-h-full ${
        isModalOpen ? "" : "hidden"
      }`}
    >
      <div class="relative w-full max-w-md max-h-full">
        <div class="relative bg-gray-300 rounded-lg shadow ">
          <button
            onClick={() => setIsModalOpen(false)}
            type="button"
            class="absolute top-3 right-2.5 text-gray-400 bg-transparent hover:bg-gray-200 hover:text-gray-900 rounded-lg text-sm w-8 h-8 ml-auto inline-flex justify-center items-center dark:hover:bg-gray-600 dark:hover:text-white"
            data-modal-hide="authentication-modal"
          >
            <svg
              class="w-3 h-3"
              aria-hidden="true"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 14 14"
            >
              <path
                stroke="currentColor"
                stroke-linecap="round"
                stroke-linejoin="round"
                stroke-width="2"
                d="m1 1 6 6m0 0 6 6M7 7l6-6M7 7l-6 6"
              />
            </svg>
            <span class="sr-only">Close modal</span>
          </button>
          <div class="px-6 py-6 lg:px-8">
            <h3 class="mb-4 text-xl font-medium text-gray-900 ">
              Sign in to our platform
            </h3>
            <form class="space-y-6" onSubmit={handleClick}>
              <div className="mb-6">
                <Input label="Title" name="title" id="title" />
              </div>
              <div className="mb-6">
                <Input label="Author" name="author" id="author" />
              </div>

              <div className="flex justify-center items-center">
                <Button type="submit" size="large" className="m-3">
                  Add
                </Button>
                <Button
                  type="button"
                  size="large"
                  variant="danger"
                  onClick={() => setIsModalOpen(false)}
                >
                  Cancel
                </Button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
